import React from "react";

export default class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  componentDidMount() {
    console.log("test");
  }

  test = () => {
    console.log('');
  }

  render() {
    return <div onClick={this.test}>hello world</div>;
  }
}

