// const React = require("react");
// const { renderToString } = require("react-dom/server");
// const temp = require("./template").default;
// const App = require("./src/page/index").default;
import React from "react";
import { renderToString } from "react-dom/server";
import temp from "./template";
import App from "./src/page/index";

module.exports = function (app, isServerRender) {
  app.get("/", (req, res) => {
    if (isServerRender) {
      const appString = renderToString(<App />);
      const html = temp({ body: appString, title: "test" });
      res.send(html);
    } else {
      const html = temp({ title: "test" });
      res.send(html);
    }
  });
};

