import React from "react";
import styles from "./index.less";

export default class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  componentWillMount() {
    console.log("will");
  }

  componentDidMount() {
    console.log("did");
  }

  test = () => {
    console.log("");
  };

  render() {
    return (
      <div className={styles.wrapper} onClick={this.test}>
        hello world
      </div>
    );
  }
}
